import * as React from 'react';
import Box from '@mui/material/Box';
import SpeedDial from '@mui/material/SpeedDial';
import SpeedDialIcon from '@mui/material/SpeedDialIcon';
import SpeedDialAction from '@mui/material/SpeedDialAction';
import { Add, Edit, Delete } from '@mui/icons-material';


const actions = [
    { icon: <Add />, name: 'Add', action: handleDialogOpen, operation: 'add' },
    { icon: <Edit />, name: 'Edit', action: handleDialogOpen, operation: 'edit' },
    { icon: <Delete />, name: 'Delete', action: handleDialogOpen, operation: 'delete' },
];

export default function BasicSpeedDial() {
    return (
        <Box sx={{ height: 320, transform: 'translateZ(0px)', flexGrow: 1 }}>
            <SpeedDial
                ariaLabel="SpeedDial basic example"
                sx={{ position: 'absolute', bottom: 16, right: 16 }}
                icon={<SpeedDialIcon />}
            >
                {actions.map((action) => (
                    <SpeedDialAction
                        key={action.name}
                        icon={action.icon}
                        tooltipTitle={action.name}
                        onClick={(e) => {
                            handleClick(e.action.operation)
                        }}
                    />
                ))}
            </SpeedDial>
        </Box>
    );
}
function handleClick(e, operation) {
    e.preventDefault();
    if (operation == "Add") {
        // do something 
    } else if (operation == "Edit") {
        //do something else
    }
    setOpen(!open);// to close the speed dial, remove this line if not needed.
};
